          },
          "minEstimatedDeliveryDate": {
            "type": "string",
            "description": "The estimated earliest date and time the shipment will be delivered at this rate. The time stamp is formatted as an ISO 8601 UTC string. Format: YYYY-MM-DDTHH:MM:SS.SSSZ Example: 2018-08-06T01:00:00.000Z"
          },
          "pickupNetworks": {
